import { CourseConsumer } from "./CourseContext";

export default function Cart() {

    return (
        <div>
            <h4>Your Cart:</h4>
            <CourseConsumer>
                {(datas) => {
                  return datas.map((data)=> {
                       console.log(data.title);
                       return <div><h2>{data.title}</h2></div>;
                   })
                }}
            </CourseConsumer>

        </div>
    )
}
